import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import '../App.css';

const PageTwo = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const { recommendationData } = location.state || {};

  const handleReset = () => {
    navigate('/');
  };

  if (!recommendationData) {
    return <div className="loader">Loading...</div>;
  }

  return (
    <div className="page">
      <h2 className="main-header">Your Personalized Recommendations</h2>
      <div className="recommendation">
        <p>{recommendationData.reasoning}</p>
        <ul>
          {recommendationData.products.map((product, index) => (
            <li key={index}>{product}</li>
          ))}
        </ul>
      </div>
      <button className="submit-button" onClick={handleReset}>
        Start Over
      </button>
    </div>
  );
};

export default PageTwo;
